// card Component
import React, { Component } from "react";
import "../App.css";

const Card = ({ title, content }) => {
    return (
        <div class="card">
            <div className="card-heading border_all">
                <h5 class="card-title">{title}</h5>
            </div>
            <div class="card-body border_all">

                <p class="card-text">{content}</p>

            </div>
        </div>
    );
};

export default Card;
